"""Представлен список чисел. Необходимо вывести те его элементы, значения которых больше предыдущего, например:src = [300, 2, 12, 44, 1, 1, 4, 10, 7, 1, 78, 123, 55]result = [12, 44, 4, 10, 78, 123]Подсказка: использовать возможности python, изученные на уроке. Подумайте, как можно сделать оптимизацию кода по памяти, по скорости."""weather_data = [300, 2, 12, 44, 1, 1, 4, 10, 7, 1, 78, 123, 55]zaq = [i for i in weather_data]  # генераторfor i in range(1, len(zaq)):  # цик перебора и сравнения    print(zaq[i - 1])